        bytes[] calldata condValues,
        bytes[] calldata updateKeys,
        bytes[] calldata updateValues,
        bytes[] calldata actions
    ) public returns (bool) {
        // Allow meta tx to call itself
        if (msg.sender != address(this) && !hasRole(ATTESTOR_ROLE, msg.sender)) {
